import "./style.scss";

function Header() {
	return (
		<header className="header">
			<ul className="list">
				<li>
					<a href="#a">Home</a>
				</li>
				<li>
					<a href="#a">App</a>
				</li>
				<li>
					<a href="#a">Content</a>
				</li>
				<li>
					<a href="#a">About</a>
				</li>
			</ul>
		</header>
	);
}

export default Header;
